import React, {Component} from "react";
import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import SecondPost from "./components/SecondPost/SecondPost";
import {BrowserRouter, Routes, Route, Link} from "react-router-dom";
import {updateNewPostText} from "./redux/store";
import Car from "./components/Car/Car";
import ProfileContainer from "./components/Profile/ProfileContainer";


const App = (props) => {

    return (
            <div className="app-wrapper">
                <Header/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Routes>
                        <Route  path="/secondPost/" element={<SecondPost
                            /*store={props.store}*/
                            dialogsData={props.state.profileData.dialogsData}
                            messagesData={props.state.profileData.messagesData }/>}/>
                        <Route  path="/profile/*" element={<ProfileContainer
                            store={props.store}
                            posts={props.state.profilePage.posts}
                            newPostText={props.state.profilePage.newPostText}
                            dispatch={props.dispatch}
                        />}/>
                        <Route  path="/Car/" element = {<Car
                            messagesCar={props.state.profileCar.messagesCar}
                            newPostCar={props.state.profileCar.newPostCar}
                            dispatch={props.dispatch}
                        />} />
                    </Routes>
                </div>
            </div>
     );
}

export default App;
